import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class NotebookService {

  constructor(private http: HttpClient ) { }

  getNotes(): Observable<void> {
    return this.http.get<void>('https://localhost:7185/api/webnotes');
  }

  saveNote(notes: [{ id: number, note: string, reminderDate: Date, header: string }]): Observable<void> {
    return this.http.post<void>('https://localhost:7185/api/webnotes', notes);
  }
}
